import React from "react";
import { useState, useEffect } from 'react';

import Video from "../components/video";

export default function HomePage() {
    const [videos, setVideos] = useState([]);
    useEffect(() => {
        fetch("https://youtube.googleapis.com/youtube/v3/videos?part=snippet&chart=mostPopular&maxResults=50&key=AIzaSyAvWZ9W7xA5cmUkjPVZxIC1tbLWgh9abiY")
        .then((res) => {
            return res.json();
        })
        .then((data) => {
            setVideos(data.items);
        });
    }, []);

    console.log(videos[0])

    return (
        <div className="home-page">
            {videos.map((video) => (
                <Video videoImage={video.snippet.thumbnails.high.url} key={video.id.videoId} />
            ))}
        </div>
    )
}
